script: |
  super -f text -I q9719.spq | sort > q9719.out

inputs:
  - name: q9719.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE + - 39 + - + col0 NOT BETWEEN + + ( - + col2 ) * - ( col2 ) AND 91;
  - name: tab0

outputs:
  - name: q9719.out
    data: |
      15	81	47
      87	21	10
      97	1	99
